interface Exam {
	subject: string
	questions: Question[]
}

interface Question {
	number: number
	image: string
}

function getExam(str: string): Exam {
	const subject = str.split("|")[2]
	const questions = [] as questions[]
	const { document } = parseHTML(str.split("|").at(-1))
	for (const img of document.querySelectorAll("img")) {
		const question = {
			number: parseInt(img.id.slice(4)),
			image: img.src,
		}
		questions.push(question)
	}
	return { subject, questions }
}


const d = (n: number) => new Promise(r => setTimeout(r, n))
const exams = q.map(i => getExam(i))
for (const { subject, questions } of exams) {
	await Deno.mkdir(`./questions/${subject}`).catch(() => {})
	for (const q of questions) {
		if (await Deno.stat(`./questions/${subject}/${q.number}.jpg`).then(_ => true).catch(e => false)) {
			continue
		}
		console.log(`${subject}-${q.number} start`)
		let res = null
		let retry = 1
		while (!res?.ok) {
			// await d(Math.random() * (2_000 * retry++) + 5000)
			res = await fetch(q.image, { headers: { "user-agent": "Mozilla/2" + Math.random() }})
			if (!res.ok) {
				console.log(await res.text())
			}
		}
		const body = await res.arrayBuffer()
		Deno.writeFile(`./questions/${subject}/${q.number}.jpg`, body)
	}
}
await Deno.writeTextFile("./questions.json", JSON.stringify(exams, null, "\t"))